import React from 'react';
import { Link } from 'react-router-dom';

import './BotonInicio.css'

export default function BotonInicio(props) {
    return ( 
        <>
            <button className="btn-inicio">
                <Link to="/" className="inicio">
                    {props.name}
                </Link>
            </button>
        </> 
        );
}
